import $ from "jquery";

export function servicesConfigLoader() {
    $.ajax({
        url: "http://localhost:3001/servicesConfig",
        method: "GET",
        success: function (data) {
            return data
        },
        error: function (xhr, status, error) {
            console.log(`Error: ${status} - ${error}`);
        }
    });
}
